import React from "react";

const Mad_libs = () => {
  return (
    <main className="App-home">
      <div>
        <h1>Mad Libs Game</h1>
      </div>
      <a
        className="App-link"
        href="https://reactjs.org"
        target="_blank"
        rel="noopener noreferrer"
      >
        Start the game
      </a>
    </main>
  );
};

export default Mad_libs;
